$( document ).ready(function() {



	// mobile menu - on click of toggle
	$('.menu-link').click(function(e){
		// prevent default
		e.preventDefault();

		// show menu as active
		$(this).next('ul').toggleClass('active');
	});



	// main banners cycle
    var gallery_i = 0;
    var gallery_delay = 8000;
    function cycle() {
    	// gets gallery list
        var gallery_list = $(".banner img");

        // gets max items
        var gallery_imax = gallery_list.length - 1;

        // fade in index/current item
        gallery_list.eq(gallery_i).fadeIn(400);

        // after delay get next/or first depending on index and fade out current and fade in next
        setTimeout(function() {
            gallery_list.eq(gallery_i).fadeOut(400, function() {
                (gallery_i == gallery_imax) ? gallery_i = 0 : gallery_i++;
                cycle();
            });
        }, gallery_delay);
    }
    // run the above function
    cycle();


    // gallery lightbox and isotope sorting
	//if (window.location.pathname.indexOf("gallery") > -1) {

		// on load
		$(window).load(function(){

			// initilise isotope on gallery wrapper
			$container = $('#gallery').isotope({ 
				itemSelector: '.gallery-item', 
				filter: '*',
			});

			// on click of a filter
			$('#gallery-filter').on( 'click', '.filter', function() {
				alert('hello');
			  // get data id selector
			  var filterValue = $(this).attr('data-id');

			  // remove active class
			  $('#gallery-filter .filter').removeClass("active");

			  // adds active class to clicked filter option
			  $(this).addClass("active");

			  // remove all data lightbox attributes
			  $('#gallery a').removeAttr('data-lightbox');

			  // adds lightbox attribute on selected gallery items (filtered)
			  $('#gallery '+filterValue+' a').attr('data-lightbox', 'current');

			  // update isotope with new filter
			  $container.isotope({ filter: filterValue });
			});
		});
	//}
});
